def _get_grouper(
    obj,
    key=None,
    axis=0,
    level=None,
    sort=True,
    observed=False,
    mutated=False,
    validate=True,
):
    group_axis = obj._get_axis(axis)

    if level is not None:
        if group_axis.name != level:
            raise ValueError(f"level name {level} is not the name of the axis")

    if key is None:
        key = group_axis

    # Process key if it's a tuple
    if isinstance(key, tuple):
        key = list(key)

    if not isinstance(key, list):
        keys = [key]
    else:
        keys = key

    # Mapping between keys and columns
    key_mapping = {col: obj[col] for col in keys}

    if len(key_mapping) == 0:
        raise ValueError("No group keys passed!")

    groupings = []
    exclusions = []

    for key in key_mapping:
        ping = (
            Grouping(
                group_axis,
                key_mapping[key],
                obj=obj,
                name=key,
                level=level,
                sort=sort,
                observed=observed,
            )
        )

        groupings.append(ping)

    if len(groupings) == 0 and len(obj):
        raise ValueError("No group keys passed!")
    elif len(groupings) == 0:
        groupings.append(Grouping(Index([], dtype="int"), np.array([], dtype=np.intp)))

    grouper = BaseGrouper(group_axis, groupings, sort=sort, mutated=mutated)

    return grouper, exclusions, obj
